(92, '', '<p>Berikut Struktur Organisasi Pemerintahan Nagari Tandikek Barat Kecamatan Patamuan Kabupaten Padang Pariaman.<br /><br /></p>\r\n<p><img src=\"http://tandikek-barat.padangpariamankab.go.id/assets/../desa/upload/media/Picture1.png\" alt=\"struktur organisasi dan tata kerja\" width=\"1077\" height=\"440\" /></p>\r\n<p>&nbsp;</p>', 1, '2016-08-24 14:39:56', 999, 1, 'Struktur Organisasi Pemerintahan Nagari Tandikek Barat Kecamatan Patamuan Kabupaten Padang Pariaman', 0, '1472006396', '1472006396', '1472006396', '', '', 1, 'pemerintah-desa', 13, NULL, 3),
(93, '', '<p><strong>VISI :</strong></p>\r\n<p>Terwujudnya Masyarakat Nagari Tandikek Barat yang tentram, maju, Makmur, yang berpedoman kepada Adat Bersandi Syarak, Syarak Bersandi Kitabullah</p>\r\n<p>&nbsp;</p>\r\n<p><strong>MISI :</strong></p>\r\n<ol>\r\n<li>Optimalisasi penyelenggaraan pemerintah Nagari Tandikek Barat</li>\r\n<li>Mewujudkan sarana dan prasarana desa yang memadai</li>\r\n<li>Memberdayakan semua potensi yang ada di Masyarakat</li>\r\n<li>Terwujudnya keamanan dan kesejahteraan Masyarakat</li>\r\n</ol>', 1, '2016-08-24 14:48:28', 999, 1, 'Visi dan Misi', 0, '1472006908', '1472006908', '1472006908', '', '', 1, 'visi-dan-misi', 18, NULL, 3),
(97, '1472019299', '<p>Halaman ini berisi tautan menuju informasi mengenai Basis Data Desa. Ada dua jenis data yang dimuat dalam sistem ini, yakni basis data kependudukan dan basis data sumber daya desa. Sila klik pada tautan berikut untuk mendapatkan tampilan data statistik per kategori.</p>\r\n<ol>\r\n<li>Data Wilayah Administratif&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</li>\r\n<li>Data Pendidikan&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</li>\r\n<li>Data Pekerjaan&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</li>\r\n<li>Data Golongan Darah&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</li>\r\n<li>Data Agama&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</li>\r\n<li>Data Jenis Kelamin&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</li>\r\n<li>Data Kelompok Umur&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</li>\r\n<li>Data Penerima Raskin&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</li>\r\n<li>Data Penerima BPJS &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n<li>Data Warga Negara &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp;</li>\r\n</ol>\r\n<p>Data yang tampil adalah statistik yang didapatkan dari proses olah data dasar yang dilakukan secara&nbsp;<em>offline</em>&nbsp;di kantor desa secara rutin/harian. Data dasar di kantor desa diunggah ke dalam sistem&nbsp;<em>online</em>&nbsp;di website ini secara berkala. Sila hubungi kontak pemerintah desa untuk mendapatkan data dan informasi desa termutakhir.</p>', 1, '2016-08-24 18:14:59', 999, 1, 'Data Desa', 0, '1472019299', '1472019299', '1472019299', '', '', 1, 'data-desa', 5, NULL, 3),
(98, '1549419108_desa.jpg', '<p>Wilayah desa berisi tentang penjelasan dan deskripsi letak wilayah desa. contohnya sebagai berikut :<br />Batas-batas :<br />Utara&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Kelurahan a<br />Timur &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Desa b<br />Selatan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Desa c<br />Barat&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Kelurahan d dan Desa e<br />Luas Wilayah Desa Penglatan&nbsp;&nbsp; : 186,193 Ha<br />Letak Dan Batas Desa x<br />Desa Penglatan terletak pada posisi 115. 7.20 LS 8. 7.10 BT, dengan ketinggian kurang lebih 250 M diatas permukaan laut.</p>\r\n<p>Peta Desa:</p>\r\n<p><iframe src=\"https://www.google.co.id/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=Logandu,+Karanggayam&amp;aq=0&amp;oq=logandu&amp;sll=-2.550221,118.015568&amp;sspn=52.267573,80.332031&amp;t=h&amp;ie=UTF8&amp;hq=&amp;hnear=Logandu,+Karanggayam,+Kebumen,+Central+Java&amp;z=14=-7.55854,109.634173&amp;output=embed\" width=\"600\" height=\"450\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe></p>', 1, '2016-08-26 18:28:14', 999, 1, 'Wilayah Desa', 0, '1472192894', '1472192894', '1472192894', '', '', 1, 'wilayah-desa', 11, NULL, 3),
(99, '', '<p style=\"text-align: justify;\">Pada tahun 2011, masyarakat di Korong Lareh Nan Panjang, Korong Sarang Gagak, dan Korong Galoro ingin mempercepat pembangunan guna meningkatkan kesejahteraan masyarakat. Untuk mewujudkan hal tersebut, Nagari Tandikek Barat mengajukan pemekaran dari nagari induknya, yaitu Nagari Tandikat, yang berada di Kecamatan Patamuan, Kabupaten Padang Pariaman.</p>\r\n<p style=\"text-align: justify;\">Sebelumnya, Nagari Tandikek Barat hanya terdiri dari tiga korong. Namun, pada 9 Desember 2011, di bawah kepemimpinan Jender Tanjung sebagai ketua dan Harli Bastian sebagai sekretaris, masyarakat menginisiasi pemekaran nagari dengan mengajukan proposal resmi. Upaya ini membuahkan hasil pada tahun 2016, ketika pemerintah mengeluarkan izin pemekaran persiapan dan menunjuk wali nagari sementara. Kemudian, pada Mei 2018, dilakukan pemilihan wali nagari definitif.</p>\r\n<p style=\"text-align: justify;\">Seiring perkembangan, untuk membuka lebih banyak lapangan pekerjaan dan meningkatkan tata kelola pemerintahan, tiga korong awal dimekarkan menjadi delapan korong, dengan rincian sebagai berikut:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>\r\n<p>Korong Lareh Nan Panjang dibagi menjadi 3 :<br />1. Korong Lareh Nan Panjang<br />2. Korong Durian Condong Lareh Nan Panjang<br />3. Korong Parit Tangah Lareh Nan Panjang</p>\r\n</li>\r\n<li>\r\n<p>Korong Sarang Gagak dibagi menjadi 2 :<br />4. Korong Sarang Gagak<br />5. Korong Jambu Kaliang Sarang Gagak</p>\r\n</li>\r\n<li>\r\n<p>Korong Galoro dibagi menjadi 3 :<br />6. Korong Tanjung Raya Galoro<br />7. Korong Panyalai Galoro<br />8. Korong Kampung Parit Galoro</p>\r\n</li>\r\n</ul>\r\n<h3 style=\"text-align: justify;\">Jenis Pemekaran Nagari</h3>\r\n<p style=\"text-align: justify;\">Nagari Tandikek Barat mengalami pemekaran pemerintah nagari, bukan pemekaran nagari secara administratif penuh. Perbedaan utama antara kedua jenis pemekaran ini adalah:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Pemekaran nagari: Harus memiliki masjid, balairung (balai pertemuan), dan balai adat sebagai pusat kegiatan masyarakat adat.</li>\r\n<li>Pemekaran pemerintah nagari: Tidak memerlukan masjid, balairung, atau balai adat, karena struktur adat tetap berada di nagari induk.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Dengan demikian, meskipun secara administratif Nagari Tandikek Barat berdiri sendiri, keaslian adatnya masih berada di Nagari Tandikat.</p>\r\n<h3 style=\"text-align: justify;\">Asal-usul Nama Korong di Nagari Tandikek Barat</h3>\r\n<p style=\"text-align: justify;\">Setiap korong di Nagari Tandikek Barat memiliki sejarah dan filosofi tersendiri dalam penamaannya:</p>\r\n<ol style=\"text-align: justify;\">\r\n<li>\r\n<p>Korong Lareh Nan Panjang</p>\r\n<ul>\r\n<li>Nama ini diberikan karena wilayahnya memanjang.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Korong Durian Condong Lareh Nan Panjang</p>\r\n<ul>\r\n<li>Banyak terdapat pohon durian yang condong, serta merupakan hasil pemekaran dari Korong Lareh Nan Panjang.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Korong Parit Tangah Lareh Nan Panjang</p>\r\n<ul>\r\n<li>Wilayah ini dihubungkan oleh parit-parit, sehingga dinamakan Parit Tangah.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Korong Sarang Gagak</p>\r\n<ul>\r\n<li>Di daerah ini pernah tinggal seseorang yang dikenal kuat dengan julukan \"Gagak\".</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Korong Jambu Kaliang Sarang Gagak</p>\r\n<ul>\r\n<li>Banyak ditemukan buah-buahan seperti jambu, dan merupakan hasil pemekaran dari Korong Sarang Gagak.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Korong Tanjung Raya Galoro</p>\r\n<ul>\r\n<li>Sebagian besar penduduknya berasal dari suku Tanjung, sehingga dinamakan Tanjung Raya.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Korong Panyalai Galoro</p>\r\n<ul>\r\n<li>Masyarakat di sini umumnya berasal dari suku Panyalai, sehingga diberikan nama tersebut.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Korong Kampung Parit Galoro</p>\r\n<ul>\r\n<li>Wilayahnya dipenuhi dengan jaringan parit, sehingga dinamakan Kampung Parit.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">Nama Galoro berasal dari sejarah daerah tersebut, di mana dahulu sering terdengar suara gemuruh atau galodo (bahasa Minang untuk banjir bandang), sehingga masyarakat menamainya Galoro.</p>', 1, '2025-01-19 05:00:00', 999, 1, 'Sejarah Nagari', 3, '', '', '', '', '', 1, 'sejarah-desa', 20, NULL, 3);
INSERT INTO `artikel` (`id`, `gambar`, `isi`, `enabled`, `tgl_upload`, `id_kategori`, `id_user`, `judul`, `headline`, `gambar1`, `gambar2`, `gambar3`, `dokumen`, `link_dokumen`, `boleh_komentar`, `slug`, `hit`, `urut`, `jenis_widget`) VALUES
(101, '1738047965_tubing.jpeg', '<div class=\"teks\">\r\n<h1>&nbsp;</h1>\r\n<h1>&nbsp;</h1>\r\n<h1>&nbsp;</h1>\r\n<h1>&nbsp;</h1>\r\n<h1 style=\"text-align: center;\">Sensasi Tubing Seru di Alam Nagari Tandikek Barat</h1>\r\n<h2>Menyatu dengan Alam di Tandikek Barat</h2>\r\n<p>Nagari Tandikek Barat, yang terletak di tengah keindahan alam Sumatera Barat, menyimpan sebuah pengalaman wisata unik yang cocok untuk para pencinta petualangan dan alam. Salah satu kegiatan yang sedang naik daun di daerah ini adalah tubing, sebuah aktivitas seru menyusuri sungai menggunakan ban dalam besar.</p>\r\n<p>Bersama teman atau keluarga, wisatawan dapat menikmati segarnya udara pedesaan dan derasnya aliran sungai yang dikelilingi pepohonan hijau. Pengalaman tubing ini bukan hanya memberikan keseruan, tetapi juga mendekatkan wisatawan pada pesona alam khas nagari yang masih asri.</p>\r\n<h2>Aktivitas Tubing yang Aman dan Menyenangkan</h2>\r\n<p>Dalam foto terlihat rombongan wisatawan yang bersiap memulai tubing dengan menggunakan perlengkapan lengkap seperti helm dan pelampung. Hal ini menunjukkan bahwa keselamatan pengunjung menjadi prioritas utama. Selain itu, masyarakat lokal berperan aktif sebagai pemandu, memastikan setiap peserta mendapatkan pengalaman terbaik sekaligus menjaga keamanan.</p>\r\n<p>Sungai di Tandikek Barat memiliki arus yang bervariasi, memberikan sensasi berbeda di setiap perjalanan. Bagi pemula, arus yang lebih tenang memberikan rasa nyaman, sementara mereka yang menyukai tantangan dapat menikmati arus yang lebih deras.</p>\r\n<h2>Suasana Ceria dan Kebersamaan</h2>\r\n<p>Kegiatan tubing di Tandikek Barat bukan hanya soal menaklukkan arus sungai, tetapi juga menciptakan momen kebersamaan. Foto di atas memperlihatkan senyum dan semangat para peserta sebelum memulai petualangan mereka. Dengan suasana ceria, kegiatan ini menjadi cara yang sempurna untuk mempererat hubungan antar teman atau keluarga.</p>\r\n<h2>Menyokong Ekonomi Lokal</h2>\r\n<p>Selain memberikan pengalaman tak terlupakan bagi wisatawan, tubing juga menjadi sumber penghidupan bagi masyarakat sekitar. Dari penyewaan peralatan, jasa pemandu, hingga usaha kecil seperti warung makan, aktivitas ini membantu meningkatkan ekonomi Nagari Tandikek Barat.</p>\r\n<h2>Mengundang Wisatawan untuk Berkunjung</h2>\r\n<p>Nagari Tandikek Barat adalah destinasi yang sempurna untuk melepaskan penat dari hiruk-pikuk perkotaan. Dengan keindahan alam yang memukau, keramahan masyarakat, dan aktivitas tubing yang seru, tempat ini layak menjadi tujuan liburan Anda berikutnya.</p>\r\n<p>Jadi, tunggu apa lagi? Segera rencanakan perjalanan Anda ke Tandikek Barat dan nikmati pengalaman tubing yang tak terlupakan!</p>\r\n</div>', 1, '2025-01-28 07:06:05', 1, 1, 'Sensasi Tubing Seru di Alam Nagari Tandikek Barat', 0, NULL, NULL, NULL, NULL, '', 1, 'sensasi-tubing-seru-di-alam-nagari-tandikek-barat', 6, NULL, 3),
(102, NULL, '<p style=\"text-align: center;\">Badan Musyawarah (BAMUS)</p>\r\n<p>Badan Musyawarah (BAMUS) adalah lembaga perwakilan masyarakat di tingkat Nagari yang berfungsi sebagai wadah untuk menyampaikan aspirasi warga, mengawasi jalannya pemerintahan, serta turut serta dalam pengambilan keputusan bersama Wali Nagari. Berikut adalah susunan organisasi BAMUS Nagari Tandikek Barat untuk periode 2022-2028:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://tandikek-barat.padangpariamankab.go.id/assets/../desa/upload/media/bamus.png\" alt=\"\" width=\"705\" height=\"690\" /></p>', 1, '2025-02-02 09:47:44', 999, 1, 'Badan Musyawarah', 0, NULL, NULL, NULL, NULL, '', 1, 'badan-musyawarah', 7, NULL, 3),
(103, NULL, '<p style=\"text-align: center;\">Lembaga Pemberdayaan Masyarakat (LPM)</p>\r\n<p>Lembaga Pemberdayaan Masyarakat, yang biasa disingkat LPM adalah sebuah organisasi yang dibentuk oleh masyarakat. Tujuan dari LPM ini adalah membantu meningkatkan partisipasi dan pemberdayaan masyarakat dari berbagai macam kegiatan, seperti berhubungan dengan aspek ekonomi, sosial, budaya, lingkungan, dsb. Adapun struktur organisasi dari LPM di Nagari Tandikek Barat yaitu:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://tandikek-barat.padangpariamankab.go.id/assets/../desa/upload/media/LPM.png\" alt=\"\" width=\"698\" height=\"512\" /></p>', 1, '2025-02-02 09:48:45', 999, 1, 'Lembaga Pemberdayaan Masyarakat ', 0, NULL, NULL, NULL, NULL, '', 1, 'lembaga-pemberdayaan-masyarakat', 6, NULL, 3),
(104, NULL, '<p style=\"text-align: center;\">Pemberdayaan Kesejahteraan Keluarga (PKK)</p>\r\n<p>Pemberdayaan Kesejahteraan Keluarga, yang biasa disingkat PKK, merupakan organisasi bertujuan untuk memberdayakan keluarga untuk meningkatkan kesejahteraan dalam bidang kesehatan, kualitas hidup keluaarga atau masyakarakat, dan lainnya. Anggota dari PKK biasanya perempuan. Pada Nagari Tandikek Barat ini terdapat kelompok-kelompok Dasawisma pada tiap Korong, berisi beberapa anggota di dalamnya.</p>', 1, '2025-02-02 09:49:22', 999, 1, 'Pemberdayaan Kesejahteraan Keluarga', 0, NULL, NULL, NULL, NULL, '', 1, 'pemberdayaan-kesejahteraan-keluarga', 3, NULL, 3),
(105, NULL, '<p style=\"text-align: center;\">Karang Taruna Tandikek Barat</p>\r\n<p>Karang Taruna adalah organisasi kepemudaan yang turut berperan di bidang sosial yang berperan pada pembangunan masyakarakat. Untuk saat ini, Karang Taruna di Tandikek Barat sedang tidak aktif.</p>', 1, '2025-02-02 09:49:44', 999, 1, 'Karang Taruna Tandikek Barat', 0, NULL, NULL, NULL, NULL, '', 1, 'karang-taruna-tandikek-barat', 7, NULL, 3),
(107, NULL, '<h3><strong> </strong><strong>Jumlah Penduduk Berdasarkan Kelompok Jenis Kelamin</strong></h3>\r\n<table width=\"442\">\r\n<tbody>\r\n<tr>\r\n<td width=\"34\">\r\n<p>No</p>\r\n</td>\r\n<td width=\"203\">\r\n<p>Jenis Kelamin</p>\r\n</td>\r\n<td width=\"205\">\r\n<p>Jumlah</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"34\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"203\">\r\n<p>Laki-Laki</p>\r\n</td>\r\n<td width=\"205\">\r\n<p>1.006</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"34\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"203\">\r\n<p>Perempuan</p>\r\n</td>\r\n<td width=\"205\">\r\n<p>1.023</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\" width=\"237\">\r\n<p>Total</p>\r\n</td>\r\n<td width=\"205\">\r\n<p>2.029</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<h3><strong>Jumlah Penduduk Berdasarkan Kelompok Usia</strong></h3>\r\n<p>Jumlah penduduk di Tandikek Barat didominasi oleh kelompok usia produktif, yaitu mereka yang berusia 18-55 tahun, sebagaimana terlihat pada tabel di bawah ini:</p>\r\n<table width=\"444\">\r\n<tbody>\r\n<tr>\r\n<td width=\"38\">\r\n<p>No</p>\r\n</td>\r\n<td width=\"198\">\r\n<p>Usia</p>\r\n</td>\r\n<td width=\"208\">\r\n<p>Jumlah</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"38\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"198\">\r\n<p>0-17 tahun</p>\r\n</td>\r\n<td width=\"208\">\r\n<p>629</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"38\">\r\n<p>2</p>\r\n</td>\r\n<td width=\"198\">\r\n<p>18-55 tahun</p>\r\n</td>\r\n<td width=\"208\">\r\n<p>1.067</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"38\">\r\n<p>3</p>\r\n</td>\r\n<td width=\"198\">\r\n<p>55 ke-atas</p>\r\n</td>\r\n<td width=\"208\">\r\n<p>333</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3><strong>&nbsp;</strong></h3>\r\n<ul>\r\n<li><strong> </strong><strong>Jumlah Keluarga dan Persentase Perkembangan</strong></li>\r\n</ul>\r\n<p>Tabel data jumlah keluarga di bawah ini berdasarkan data dari data perkembangan penduduk dari Nagari Tandikek Barat pada tahun 2020. Tabel tersebut bisa dilihat di bawah ini:</p>\r\n<table width=\"520\">\r\n<tbody>\r\n<tr>\r\n<td width=\"114\">\r\n<p>Jumlah</p>\r\n</td>\r\n<td width=\"114\">\r\n<p>KK Laki-laki</p>\r\n</td>\r\n<td width=\"114\">\r\n<p>KK Perempuan</p>\r\n</td>\r\n<td width=\"179\">\r\n<p>Jumlah Total</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"114\">\r\n<p>Jumlah Kepala Keluarga tahun ini</p>\r\n</td>\r\n<td width=\"114\">\r\n<p>1973 KK</p>\r\n</td>\r\n<td width=\"114\">\r\n<p>38 KK</p>\r\n</td>\r\n<td width=\"179\">\r\n<p>2011 KK</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"114\">\r\n<p>Jumlah Kepala Keluarga tahun lalu</p>\r\n</td>\r\n<td width=\"114\">\r\n<p>550 KK</p>\r\n</td>\r\n<td width=\"114\">\r\n<p>62 KK</p>\r\n</td>\r\n<td width=\"179\">\r\n<p>612 KK</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"114\">\r\n<p>Persentase perkembangan</p>\r\n</td>\r\n<td width=\"114\">\r\n<p>258.73%</p>\r\n</td>\r\n<td width=\"114\">\r\n<p>-38.71%</p>\r\n</td>\r\n<td width=\"179\">\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<h3><strong>Jumlah Penduduk Berdasarkan Korong</strong></h3>\r\n<p>Pada Nagari Tandikek Barat, terdapat 8 korong yang masing-masingnya memiliki berbagai macam jumlah penduduk. Mayoritas penduduk banyak di Korong Lareh Nan Panjang. Data tersebut bisa dilihat berdasarkan tabel di bawah ini:</p>\r\n<table width=\"518\">\r\n<tbody>\r\n<tr>\r\n<td rowspan=\"2\" width=\"28\">\r\n<p>No</p>\r\n</td>\r\n<td rowspan=\"2\" width=\"170\">\r\n<p>Korong</p>\r\n</td>\r\n<td colspan=\"3\" width=\"320\">\r\n<p>Jumlah Penduduk</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"104\">\r\n<p>Laki-Laki</p>\r\n</td>\r\n<td width=\"113\">\r\n<p>Perempuan</p>\r\n</td>\r\n<td width=\"102\">\r\n<p>Jumlah</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"28\">\r\n<p>1</p>\r\n</td>\r\n<td width=\"170\">\r\n<p>Lareh Nan Panjang</p>\r\n</td>\r\n<td width=\"104\">\r\n<p>357</p>\r\n</td>\r\n<td width=\"113\">\r\n<p>379</p>\r\n</td