pan style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-ID\" style=\"font-family: \'Times New Roman\',serif;\">Sebelah selatan berbatasan dengan Batu Kalang Utara</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 60.55pt; mso-add-space: auto; text-align: justify; text-indent: -.25in; line-height: 150%; mso-list: l0 level1 lfo2;\"><span lang=\"EN-ID\" style=\"font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-ID\" style=\"font-family: \'Times New Roman\',serif;\">Sebelah timur berbatasan dengan daerah Tandikek</span></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 60.55pt; mso-add-space: auto; text-align: justify; text-indent: -.25in; line-height: 150%; mso-list: l0 level1 lfo2;\"><span lang=\"EN-ID\" style=\"font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';\"><span style=\"mso-list: Ignore;\">4.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-ID\" style=\"font-family: \'Times New Roman\',serif;\">Sebelah barat berbatasan dengan Gunung Padang Alai</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 21.3pt; text-align: justify; text-indent: 21.25pt; line-height: 150%;\"><span lang=\"EN-ID\" style=\"font-family: \'Times New Roman\',serif;\">Nagari Tandikek Barat mempunyai jarak ke pusat pemerintahan kecamatan sekitar 5 km, lama jarak tempuh ke ibukota kecamatan dengan kendaraan bermotor sekitar 0,20 jam. Untuk jarak dari pusat pemerintahan kota ke<span style=\"mso-spacerun: yes;\">&nbsp; </span>Nagari Tandikek Barat ini sekitar 20 km. <span style=\"mso-spacerun: yes;\">&nbsp;</span>Jika naik kendaraan waktu tempuhnya yaitu 1 jam. Dan yang terakhir, untuk jarak dari nagari Tandikek Barat ke ibukota provinsi (Padang) sekitar 60 km. Jika menggunakan kendaraan bermotor, waktu tempuh yang dibutuhkan ke ibukota provinsi yaitu 2 jam.</span></p>\r\n<div class=\"btn-group\" style=\"clear: both;\" role=\"group\" aria-label=\"Bagikan ke teman anda\"><a title=\"Facebook\" href=\"http://www.facebook.com/sharer.php?u=https://tandikek-barat.padangpariamankab.go.id/index.php/artikel/2025/2/2/profil-wilayah-desa\" target=\"_blank\" rel=\"noopener noreferrer\" name=\"fb_share\"></a></div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1, '2025-02-02 10:05:05', 999, 1, 'Profil Wilayah Nagari', 0, NULL, NULL, NULL, NULL, '', 1, 'profil-wilayah-desa-1', 12, NULL, 3),
(110, '1738638380_do.jpeg', '<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 24pt;\">KKN UNIVERSITAS ANDALAS</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Dalam rangka meningkatkan pembangunan dan pemberdayaan masyarakat di Nagari Tandikek Barat, Universitas Andalas melalui program Kuliah Kerja Nyata (KKN) melaksanakan Lokakarya Program Kerja (Proker) KKN Tandikek Barat 2025. Lokakarya ini bertujuan untuk merancang dan menyusun program-program yang dapat memberikan dampak positif bagi masyarakat, khususnya di bidang teknologi, pertanian, dan sosial. Berikut adalah beberapa program kerja yang akan dilaksanakan:</p>\r\n<h3><strong>Sistem Informasi dan Profil Nagari</strong></h3>\r\n<ol start=\"1\">\r\n<li>\r\n<p><strong>Pembuatan Website</strong>: Membangun website resmi Nagari Tandikek Barat untuk memudahkan akses informasi bagi masyarakat dan pihak luar.</p>\r\n</li>\r\n<li>\r\n<p><strong>Pembuatan Profil Nagari</strong>: Menyusun profil lengkap Nagari Tandikek Barat yang mencakup potensi, sejarah, dan data kependudukan.</p>\r\n</li>\r\n<li>\r\n<p><strong>Pembuatan QRIS</strong>: Mengimplementasikan sistem pembayaran digital melalui QRIS untuk memudahkan transaksi ekonomi.</p>\r\n</li>\r\n<li>\r\n<p><strong>Pengenalan dan Workshop Pendidikan Literasi Digital</strong>: Memberikan pelatihan dan edukasi tentang pentingnya literasi digital bagi masyarakat.</p>\r\n</li>\r\n<li>\r\n<p><strong>Digitalisasi Data Desa</strong>: Mengubah data desa dari format manual ke digital untuk memudahkan pengelolaan dan akses.</p>\r\n</li>\r\n<li>\r\n<p><strong>Pelatihan Teknologi</strong>: Melatih masyarakat dalam penyusunan SOP (Standard Operating Procedure) berbasis online.</p>\r\n</li>\r\n<li>\r\n<p><strong>Edukasi Pengelolaan Sosial Media</strong>: Memberikan pelatihan tentang cara mengelola media sosial Nagari Tandikek Barat secara efektif.</p>\r\n</li>\r\n</ol>\r\n<h3><strong>Pertanian dan Perkebunan</strong></h3>\r\n<ol start=\"1\">\r\n<li>\r\n<p><strong>Pembuatan Alat Pengusir Hama</strong>: Mengembangkan alat pengusir hama yang ramah lingkungan untuk meningkatkan hasil pertanian.</p>\r\n</li>\r\n<li>\r\n<p><strong>Pembuatan Alat Pengukur Sensor Kelembaban Tanah</strong>: Membuat alat yang dapat mengukur kelembaban tanah secara otomatis.</p>\r\n</li>\r\n<li>\r\n<p><strong>Edukasi Penggunaan Pupuk Organik</strong>: Memberikan pelatihan tentang penggunaan pupuk organik dan pemilihan jenis tanah yang tepat untuk budidaya tanaman.</p>\r\n</li>\r\n<li>\r\n<p><strong>Pembuatan Pupuk Organik</strong>: Melatih masyarakat dalam pembuatan pupuk organik dari bahan-bahan alami.</p>\r\n</li>\r\n<li>\r\n<p><strong>Edukasi dan Pelatihan Pembuatan E-Commerce</strong>: Mengajarkan cara membuat dan mengelola e-commerce untuk memasarkan produk pertanian.</p>\r\n</li>\r\n<li>\r\n<p><strong>Cara Pembuatan Packaging dan Pemasaran Produk</strong>: Memberikan pelatihan tentang teknik packaging dan strategi pemasaran produk.</p>\r\n</li>\r\n<li>\r\n<p><strong>TOGA (Tanaman Obat Keluarga)</strong>: Mengembangkan dan mempromosikan tanaman obat keluarga untuk kesehatan masyarakat.</p>\r\n</li>\r\n<li>\r\n<p><strong>Edukasi Penggunaan Obat Tradisional Herbal</strong>: Memberikan pengetahuan tentang penggunaan obat tradisional berbahan herbal.</p>\r\n</li>\r\n<li>\r\n<p><strong>Pengolahan Sumber Daya Pangan</strong>: Melatih masyarakat dalam pengolahan hasil pertanian seperti pepaya, pisang, dan durian.</p>\r\n</li>\r\n</ol>\r\n<h3><strong>Sosial dan Masyarakat</strong></h3>\r\n<ol start=\"1\">\r\n<li>\r\n<p><strong>Perayaan Isra Mi\'Raj</strong>: Menyelenggarakan perayaan Isra Mi\'Raj sebagai bentuk kegiatan keagamaan dan sosial.</p>\r\n</li>\r\n<li>\r\n<p><strong>Tandikek CUP</strong>: Mengadakan turnamen olahraga untuk meningkatkan kebersamaan dan kesehatan masyarakat.</p>\r\n</li>\r\n<li>\r\n<p><strong>GORO</strong>: Melakukan kegiatan gotong royong untuk membersihkan lingkungan dan meningkatkan rasa kebersamaan.</p>\r\n</li>\r\n<li>\r\n<p><strong>Senam</strong>: Mengadakan kegiatan senam rutin untuk meningkatkan kesehatan dan kebugaran masyarakat.</p>\r\n</li>\r\n</ol>\r\n<p>Lokakarya ini diharapkan dapat menjadi wadah bagi mahasiswa KKN Universitas Andalas untuk berkontribusi secara nyata dalam pembangunan Nagari Tandikek Barat. Melalui program-program yang dirancang, diharapkan masyarakat dapat merasakan manfaat langsung dari kegiatan KKN ini, baik dalam bidang teknologi, pertanian, maupun sosial.</p>\r\n<p>Dengan semangat kolaborasi dan gotong royong, program KKN Universitas Andalas Tandikek Barat 2025 diharapkan dapat menjadi langkah awal menuju Nagari Tandikek Barat yang lebih maju dan sejahtera.</p>', 1, '2025-02-04 03:06:20', 1, 1, 'LOKA KARYA PROKER KKN UNIVERSITAS ANDALAS TANDIKEK BARAT 2025', 0, NULL, NULL, NULL, NULL, '', 1, 'loka-karya-proker-kkn-universitas-andalas-tandikek-barat-2025', 4, NULL, 3),
(111, '', '<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 24pt;\">Sabtu, 25 Januari 2025, Mahasiswa Kuliah Kerja Nyata Universitas Andalas</span></p>\r\n<p>&nbsp;</p>\r\n<p data-pm-slice=\"1 1 []\"><strong>Sosialisasi, Penerapan, dan Praktik Edukasi Internet dengan Bijak dan PHBS di SDN 07 Patamuan</strong></p>\r\n<p>Pada awal tahun ini, SDN 07 Patamuan menjadi tuan rumah kegiatan sosialisasi yang mengangkat dua tema penting, yaitu edukasi tentang penggunaan internet secara bijak dan penerapan Perilaku Hidup Bersih dan Sehat (PHBS). Acara ini diselenggarakan dengan tujuan memberikan wawasan dan praktik langsung kepada siswa, guru, dan masyarakat sekitar untuk menghadapi tantangan era digital dan menjaga kesehatan sehari-hari.</p>\r\n<p><strong>Latar Belakang</strong></p>\r\n<p>Di era digital yang semakin berkembang pesat, internet menjadi bagian integral dari kehidupan sehari-hari, termasuk di kalangan siswa sekolah dasar. Namun, penggunaan internet yang tidak terarah dapat membawa dampak negatif, seperti paparan konten yang tidak sesuai usia, kecanduan, hingga gangguan kesehatan mental. Selain itu, pentingnya PHBS dalam kehidupan sehari-hari menjadi kunci utama dalam menciptakan lingkungan yang sehat, terutama di masa pasca-pandemi.</p>\r\n<p>Melalui kegiatan ini, penyelenggara berharap dapat mengedukasi siswa tentang cara memanfaatkan internet untuk hal-hal positif seperti belajar, mencari informasi, dan meningkatkan kreativitas. Bersamaan dengan itu, mereka juga diajarkan pentingnya menjaga kebersihan dan kesehatan, baik di rumah maupun di sekolah.</p>\r\n<p><strong>Rangkaian Acara</strong></p>\r\n<p>Kegiatan dimulai dengan pembukaan oleh kepala sekolah SDN 07 Patamuan, yang menyampaikan pentingnya kolaborasi antara sekolah, keluarga, dan masyarakat dalam mendidik generasi muda. Dilanjutkan dengan sesi edukasi oleh tim pemateri yang terdiri dari mahasiswa, relawan, dan praktisi pendidikan.</p>\r\n<ol start=\"1\" data-spread=\"true\">\r\n<li>\r\n<p><strong>Sosialisasi Internet Bijak:</strong></p>\r\n<ul data-spread=\"false\">\r\n<li>\r\n<p>Siswa diajarkan tentang keamanan internet, seperti menjaga kerahasiaan data pribadi dan mengenali tanda-tanda berita palsu.</p>\r\n</li>\r\n<li>\r\n<p>Ada simulasi penggunaan aplikasi edukasi dan diskusi tentang konten digital yang bermanfaat.</p>\r\n</li>\r\n<li>\r\n<p>Para siswa juga diajak membuat komitmen tertulis untuk menggunakan internet secara bijak.</p>\r\n</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><strong>Penerapan PHBS:</strong></p>\r\n<ul data-spread=\"false\">\r\n<li>\r\n<p>Tim pemateri mengajarkan cara mencuci tangan dengan benar menggunakan enam langkah WHO.</p>\r\n</li>\r\n<li>\r\n<p>Siswa diajak mempraktikkan menjaga kebersihan lingkungan sekolah, seperti membuang sampah pada tempatnya dan menjaga kebersihan toilet.</p>\r\n</li>\r\n<li>\r\n<p>Ada permainan interaktif untuk mengenalkan gizi seimbang dan pentingnya olahraga.</p>\r\n</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p><strong>Antusiasme dan Respons Peserta</strong></p>\r\n<p>Kegiatan ini mendapat sambutan hangat dari siswa, guru, dan masyarakat sekitar. Para siswa terlihat antusias mengikuti setiap sesi, terutama ketika mereka diminta mempraktikkan langsung materi yang diberikan. Guru-guru SDN 07 Patamuan juga mengapresiasi inisiatif ini, karena dapat memperkuat pendidikan karakter siswa dalam memanfaatkan teknologi dan menjaga kesehatan.</p>\r\n<p><strong>Hasil dan Harapan</strong></p>\r\n<p>Sebagai hasil dari kegiatan ini, siswa diharapkan mampu memanfaatkan internet secara bijak untuk mendukung proses belajar mereka. Selain itu, penerapan PHBS diharapkan menjadi kebiasaan yang tertanam sejak dini, sehingga mereka dapat menjadi generasi yang sehat dan produktif.</p>\r\n<p>Pihak sekolah berencana melanjutkan program ini secara berkala dengan dukungan dari berbagai pihak, termasuk pemerintah daerah dan komunitas lokal. Dengan begitu, edukasi tentang internet bijak dan PHBS tidak hanya menjadi kegiatan satu kali, tetapi juga menjadi bagian dari budaya sekolah.</p>\r\n<p>Melalui kegiatan ini, SDN 07 Patamuan membuktikan bahwa kolaborasi yang baik antara sekolah dan masyarakat dapat menciptakan generasi muda yang cerdas digital dan peduli terhadap kesehatan.</p>', 2, '2025-02-04 03:12:21', 1, 1, 'Sosialisasi,  Penerapan, dan Praktik Edukasi Internet dengan Bijak dan PHBS di SDN 07 Patamuan', 0, NULL, NULL, NULL, NULL, '', 1, 'sosialisasi-penerapan-dan-praktik-edukasi-internet-dengan-bijak-dan-phbs-di-sdn-07-patamuan', 5, NULL, 3),
(112, NULL, '<p data-pm-slice=\"1 1 []\"><strong>Menikmati Keindahan Alam di Ranah Nagari Tandikek Barat</strong></p>\r\n<p>Nagari Tandikek Barat menyimpan pesona alam yang luar biasa, menawarkan berbagai destinasi wisata bagi para pencinta alam dan petualang. Dari puncak gunung yang menyajikan panorama indah hingga aliran sungai yang cocok untuk aktivitas air, Tandikek Barat memiliki daya tarik tersendiri yang patut dijelajahi.</p>\r\n<p><strong>1. Panorama Mountain View di Puncak Gunuang Tigo Tandiek</strong><br />Bagi yang menyukai petualangan mendaki, Puncak Gunuang Tigo Tandiek yang berada di Korong Kampuang Paneh adalah pilihan tepat. Dari puncak ini, pengunjung bisa menikmati pemandangan spektakuler ke arah Pantai Pariaman dan Pulau Angso Duo. Pulau ini memiliki nilai sejarah tersendiri, karena dipercaya sebagai tempat peristirahatan terakhir Syekh Katik Sangko, seorang penyebar agama Islam di Nagari Tandikek. Konon, jasadnya dibawa oleh dua ekor angsa hingga akhirnya dikuburkan di Pulau Angso Duo.</p>\r\n<p><strong>2. Menjelajahi Hutan Gunuang Tigo</strong><br />Selain menawarkan pemandangan dari ketinggian, Nagari Tandikek Barat juga memiliki kawasan hutan yang asri di Gunuang Tigo. Kawasan hutan ini menjadi jalur tracking yang menarik bagi para pendaki yang ingin mencapai puncak Gunuang Tigo Tandiek. Dengan suasana yang masih alami dan udara yang sejuk, perjalanan tracking di kawasan ini menjadi pengalaman yang tak terlupakan.</p>\r\n<p><strong>3. Keseruan Atraksi Air di Sungai Lubuak Tampuniak</strong><br />Bagi yang gemar bermain air, Sungai Lubuak Tampuniak yang terletak di Korong Kampuang Paneh adalah tempat yang wajib dikunjungi. Sungai ini memiliki lebar sekitar 18 meter dengan arus yang cukup deras, menjadikannya lokasi yang cocok untuk atraksi river tubing. Aktivitas ini sangat menyenangkan bagi para pencinta olahraga air yang ingin menikmati sensasi mengarungi sungai dengan ban pelampung.</p>\r\n<p>Dengan keindahan alam yang masih terjaga, Nagari Tandikek Barat menawarkan pengalaman wisata yang lengkap, mulai dari petualangan mendaki hingga keseruan bermain air. Bagi siapa pun yang ingin menikmati keasrian alam sambil berpetualang, Tandikek Barat adalah destinasi yang tidak boleh dilewatkan.</p>\r\n<p>&nbsp;</p>', 1, '2025-02-04 03:22:26', 999, 1, 'Potensi Alam ', 0, NULL, NULL, NULL, NULL, '', 1, 'potensi-alam', 8, NULL, 3),
(113, NULL, '<p><strong>Menjelajahi Kekayaan Alam, Budaya, dan Religi di Nagari Tandikek Barat</strong></p>\r\n<p>Nagari Tandikek Barat adalah sebuah destinasi yang menawarkan pesona alam yang menakjubkan, kekayaan budaya yang unik, serta nilai-nilai religi yang kental. Terletak di Kabupaten Padang Pariaman, daerah ini memiliki daya tarik yang beragam, mulai dari keindahan puncak Gunuang Tigo, kesenian khas seperti Ulu Ambek dan Silek Tuo, hingga tradisi ziarah yang masih dijaga hingga kini. Dengan berbagai atraksi wisata yang menarik, Nagari Tandikek Barat menjadi tempat yang tepat bagi siapa pun yang ingin menikmati keindahan alam, menyelami budaya lokal, dan merasakan pengalaman spiritual yang mendalam.</p>\r\n<h3 data-pm-slice=\"1 1 []\">&nbsp;</h3>\r\n<h3 data-pm-slice=\"1 1 []\">Wisata Budaya</h3>\r\n<p><strong>1. Ulu Ambek</strong><br />Ulu Ambek adalah kesenian tradisional khas Nagari Tandikek yang memiliki ciri khas unik dibandingkan dengan kesenian serupa di Kabupaten Padang Pariaman. Di Tandikek, Ulu Ambek hanya dimainkan pada siang hari, dan ketika malam tiba, semua pertunjukan harus dihentikan.</p>\r\n<p><strong>2. Silek Tuo</strong><br />Silek Tuo merupakan seni bela diri warisan dari perguruan Rajo Sati yang diwariskan secara turun-temurun. Hingga saat ini, perguruan tersebut masih eksis dan telah mendapat pengakuan resmi dari pemerintah nagari setempat sejak tahun 2022.</p>\r\n<p><strong>3. Ritual Ziarah Syekh M. Yatim</strong><br />Ritual ini dilakukan oleh masyarakat Tandikek dan para pengikut tarekat Satari dari berbagai daerah. Ziarah ini umumnya berlangsung menjelang bulan suci Ramadhan sebagai bentuk penghormatan kepada para guru besar dan Syekh Tarikat Satari.</p>\r\n<p><strong>4. Event Budaya</strong><br />Tandikek Barat juga memiliki berbagai event budaya yang diadakan pada waktu-waktu tertentu setiap tahunnya, seperti tradisi malamang, bulan sumbareh, dan atik tolak bala. Kegiatan-kegiatan ini menjadi bagian penting dalam melestarikan budaya lokal.</p>\r\n<p><strong>5. Tambua Matam Tandikek</strong><br />Tambua Matam khas Tandikek memiliki pola tabuhan unik yang membedakannya dari daerah lain. Pola \"matam unyuik\" yang dimainkan menciptakan irama bergelombang yang khas dan menarik bagi para penikmat musik tradisional.</p>\r\n<h3>Wisata Religi</h3>\r\n<p><strong>1. Wisata Masjid Tua Mudiak Padang</strong><br />Masjid Katik Sangko, atau dikenal juga sebagai Masjid Gadang Mudiak Padang, merupakan masjid tertua di Nagari Tandikek dan bahkan di Kecamatan Patamuan. Masjid ini dulunya menjadi pusat kegiatan ibadah umat Muslim di daerah tersebut.</p>\r\n<p><strong>2. Ziarah Syekh M. Yatim</strong><br />Menjelang bulan suci Ramadhan, masyarakat Nagari Tandikek dan pengikut tarekat Satari dari berbagai daerah melakukan ziarah ke makam Syekh M. Yatim. Kegiatan ini menjadi tradisi penting bagi umat Muslim yang ingin berziarah dan berdoa untuk para ulama yang telah berjasa dalam penyebaran agama Islam.</p>\r\n<p>Dengan keindahan alam yang masih terjaga serta kekayaan budaya dan religi yang mendalam, Nagari Tandikek Barat menawarkan pengalaman wisata yang lengkap. Bagi siapa pun yang ingin menikmati keasrian alam, menggali budaya, dan merasakan spiritualitas, Tandikek Barat adalah destinasi yang tidak boleh dilewatkan.</p>\r\n<p>&nbsp;</p>', 1, '2025-02-04 03:30:45', 999, 1, 'Potensi Pariwisata ', 0, NULL, NULL, NULL, NULL, '', 1, 'potensi-pariwisata', 7, NULL, 3),
(114, NULL, '<h3><strong>Potensi Penghasilan dari Sektor Pertanian di Nagari Tandikek Barat</strong></h3>\r\n<p>Nagari Tandikek Barat tidak hanya kaya akan keindahan alam dan budaya, tetapi juga memiliki sektor pertanian yang menjadi tulang punggung ekonomi masyarakatnya. Dengan lahan subur dan iklim yang mendukung, berbagai komoditas unggulan seperti pepaya penang dan kopi Tandikek menjadi sumber penghasilan utama bagi penduduk setempat. Selain itu, keberadaan gudang penampungan hasil panen juga berperan dalam mendukung distribusi produk ke berbagai daerah. Berikut adalah beberapa sektor pertanian yang menjadi andalan masyarakat Nagari Tandikek Barat.</p>\r\n<h3><strong>1. Perkebunan Pepaya Penang: Sumber Penghasilan dari Agrowisata</strong></h3>\r\n<p>Pepaya penang menjadi salah satu komoditas unggulan yang banyak dibudidayakan oleh masyarakat Nagari Tandikek Barat. Setiap korong memiliki lahan perkebunan pepaya yang luas, menjadikannya sebagai sumber penghasilan utama bagi banyak petani. Selain dijual ke pasar lokal maupun luar daerah, pepaya ini juga menjadi daya tarik agrowisata, di mana wisatawan dapat ikut serta dalam proses panen dan menikmati buah segar langsung dari kebunnya.</p>\r\n<h3><strong>2. Kopi Tandikek: Produk Kreatif Bernilai Ekonomi Tinggi</strong></h3>\r\n<p>Kopi Gunuang Tandikek merupakan salah satu produk ekonomi kreatif yang memiliki nilai jual tinggi. Dengan rasa yang khas dan diolah secara alami tanpa bahan tambahan, kopi ini semakin diminati oleh pecinta kopi, baik dari dalam maupun luar daerah. Produksi dan penjualan kopi Tandikek menjadi salah satu sumber pendapatan penting bagi masyarakat, sekaligus membuka peluang usaha bagi petani dan pelaku usaha kecil di bidang kopi.</p>\r\n<h3><strong>3. Gudang Sampelo: Sentra Distribusi Pepaya ke Berbagai Daerah</strong></h3>\r\n<p>Sampelo, sebutan lokal untuk pepaya, menjadi komoditas utama yang mendominasi sektor pertanian di Nagari Tandikek Barat. Untuk mendukung distribusi hasil panen, banyak gudang penampungan pepaya yang tersebar di seluruh pelosok nagari. Dari gudang-gudang ini, pepaya kemudian dikirim ke berbagai daerah untuk memenuhi permintaan pasar. Keberadaan gudang ini tidak hanya membantu meningkatkan kesejahteraan petani, tetapi juga menciptakan lapangan kerja bagi masyarakat sekitar.</p>\r\n<p>Dengan potensi pertanian yang besar, Nagari Tandikek Barat mampu menciptakan sumber penghasilan yang berkelanjutan bagi warganya. Dari perkebunan hingga industri olahan, sektor ini terus berkembang dan menjadi bagian penting dalam perekonomian daerah. Potensi ini membuktikan bahwa pertanian tidak hanya menjadi sumber kehidupan, tetapi juga membuka peluang bisnis yang menjanjikan bagi masyarakat Nagari Tandikek Barat.</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>4. River Tubing<br /></strong></h3>\r\n<p><br />River Tubing merupakan salah satu suguhan wisata buatan yang ada di Nagari Tandikek Induak, berjarak sekitar 35 menit dari Bandara Internasional Minangkabau. River Tubing juga merupakan suguhan wisata dengan pemanfaatan aliran sungai Lubuak Laweh hingga berakhir di Lubuak Tampuniak Nagari Tandikek Barat, suguhan pemandangan Gunuang Tigo di kanan sungai dan agro wisata pepaya di kiri sungai merupakan pemandangan yang menyenangkan sepanjang aliran tubing, air yang jernih dan sejuk memanjakan wisatawan menikmati wisata ini.</p>', 1, '2025-02-04 03:32:28', 999, 1, 'Potensi Penghasilan ', 0, NULL, NULL, NULL, NULL, '', 1, 'potensi-penghasilan', 5, NULL, 3);
