(115, '1738829744_WhatsApp Image 2025-02-06 at 15.08.40(1).jpeg', '<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\">&nbsp;</p>\r\n<p style=\"text-align: center;\" data-pm-slice=\"1 1 []\"><span style=\"font-size: 24pt;\"><strong><span data-huuid=\"4505126839204480793\">Isra Mi\'raj</span> 2025 di Tandikek Barat: KKN UNAND Gelar Lomba Azan dan Tartil</strong></span></p>\r\n<p data-pm-slice=\"1 1 []\">Tandikek Barat &ndash; Suasana penuh semangat dan kebersamaan menyelimuti Nagari Tandikek Barat saat mahasiswa Kuliah Kerja Nyata (KKN) Universitas Andalas (UNAND) menggelar lomba azan dan tartil dalam rangka memperingati Isra Mi\'raj 2025. Acara ini menjadi wadah bagi masyarakat, terutama generasi muda, untuk memperdalam kecintaan mereka terhadap Al-Qur&rsquo;an dan syiar Islam.</p>\r\n<h3>Pembukaan Acara</h3>\r\n<p>Acara diawali dengan pembukaan resmi yang dihadiri oleh anggota KKN UNAND serta masyarakat setempat. Ketua KKN UNAND menyampaikan sambutan dengan penuh semangat, menjelaskan maksud dari kegiatan ini sebagai bentuk pengabdian kepada masyarakat sekaligus upaya meningkatkan syiar Islam di kalangan generasi muda. Doa bersama pun dipanjatkan agar acara berjalan lancar dan membawa keberkahan bagi semua yang hadir.</p>\r\n<h3>Lomba Azan: Mengasah Kemampuan dan Keindahan Suara</h3>\r\n<p>Setelah sesi pembukaan, lomba azan menjadi kompetisi pertama yang digelar. Peserta, yang terdiri dari anak-anak dan remaja, menampilkan suara terbaik mereka dalam melantunkan panggilan salat dengan penuh penghayatan. Dewan juri menilai berdasarkan kualitas suara, tajwid, serta keserasian nada. Sorak sorai dan dukungan dari penonton semakin menambah semangat para peserta untuk memberikan yang terbaik.</p>\r\n<h3>Lomba Tartil: Membaca Al-Qur&rsquo;an dengan Indah dan Benar</h3>\r\n<p>Setelah lomba azan, tibalah saat yang dinantikan, yaitu lomba tartil Al-Qur&rsquo;an. Dalam kompetisi ini, peserta diuji dalam melafalkan ayat-ayat suci dengan bacaan yang benar sesuai kaidah tajwid dan makhraj. Tak hanya suara yang fasih dan tartil yang indah, ketenangan dan penghayatan peserta dalam membaca juga menjadi poin penting dalam penilaian. Suasana menjadi begitu syahdu ketika ayat-ayat suci mengalun dengan penuh ketulusan dari para peserta.</p>\r\n<h3>Penutupan dan Penghargaan: Mengapresiasi Usaha dan Semangat Peserta</h3>\r\n<p>Setelah seluruh lomba selesai, tiba saatnya pengumuman pemenang. Para juara mendapatkan penghargaan berupa sertifikat dan hadiah sebagai bentuk apresiasi atas usaha mereka. Namun lebih dari itu, semangat dan keberanian para peserta dalam mengikuti lomba menjadi kemenangan tersendiri bagi semua yang hadir.</p>\r\n<p>Acara ini tidak hanya menjadi ajang kompetisi, tetapi juga sarana mempererat ukhuwah Islamiyah di Tandikek Barat. Mahasiswa KKN UNAND berharap kegiatan serupa dapat terus dilaksanakan agar semakin banyak generasi muda yang mencintai Al-Qur&rsquo;an dan syiar Islam. Semoga semangat kebersamaan dan pembelajaran dari acara ini terus menginspirasi masyarakat di tahun-tahun mendatang.</p>\r\n<p>&nbsp;</p>', 1, '2025-02-06 08:14:18', 1, 1, 'Menyemarakkan Isra Mi\'raj 2025: Lomba Azan dan Tartil Bersama KKN UNAND di Tandikek Barat', 0, NULL, NULL, NULL, NULL, '', 1, 'menyemarakkan-isra-mikraj-2025-lomba-azan-dan-tartil-bersama-kkn-unand-di-tandikek-barat', 6, NULL, 3),
(116, NULL, '<p style=\"text-align: justify;\">Nagari Tandikek Barat menjadi saksi kemeriahan olahraga bulutangkis dalam ajang Tandikek Cup, yang diselenggarakan oleh mahasiswa Kuliah Kerja Nyata (KKN) Universitas Andalas (Unand) dan Universitas Negeri Padang (UNP). Kegiatan yang berlangsung selama 5 hari dengan penuh semangat ini bertujuan untuk mempererat tali silaturahmi antarwarga sekaligus mendukung gaya hidup sehat di masyarakat.</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 18pt;\"><strong>Kebersamaan Melalui Olahraga&nbsp;&nbsp;</strong></span><br />Dengan dukungan penuh dari pemerintah nagari dan antusiasme masyarakat setempat, Tandikek Cup sukses menghadirkan suasana kompetisi yang seru dan menyenangkan. Pertandingan ini diikuti oleh berbagai kalangan, mulai dari pelajar hingga orang dewasa yang memiliki semangat tinggi dalam berolahraga. &nbsp;</p>\r\n<p style=\"text-align: justify;\">\"Kami ingin mengajak masyarakat untuk lebih aktif bergerak dan menjaga kesehatan. Selain itu, kegiatan ini juga menjadi ajang silaturahmi yang mempererat hubungan antarwarga,\" ujar salah satu koordinator KKN Universitas Andalas.</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 18pt;\"><strong>Kegiatan yang Mendapat Sambutan Hangat</strong></span><br />Sorak-sorai penonton dan semangat para pemain menambah kemeriahan acara ini. Bahkan, warga yang tidak ikut bertanding tetap hadir untuk memberikan dukungan dan menikmati suasana kompetisi. \"Seru sekali melihat anak muda dan warga Tandikek Barat berkumpul dalam acara yang positif seperti ini. Semoga kegiatan seperti ini bisa rutin diadakan,\" ungkap salah seorang warga.&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 18pt;\"><strong>Meningkatkan Semangat Kebersamaan&nbsp;&nbsp;</strong></span><br />Melalui Tandikek Cup, mahasiswa KKN Unand dan UNP tidak hanya menjalankan tugas pengabdian masyarakat, tetapi juga meninggalkan jejak positif di Nagari Tandikek Barat. Dengan suksesnya acara ini, diharapkan muncul lebih banyak kegiatan serupa yang dapat membangkitkan semangat olahraga dan persatuan di tengah masyarakat. &nbsp;</p>\r\n<p style=\"text-align: justify;\">Kegiatan ini menjadi bukti bahwa olahraga tidak hanya sekadar kompetisi, tetapi juga media untuk memperkuat ikatan sosial dan meningkatkan kesehatan masyarakat.</p>', 1, '2025-02-06 09:18:23', 1, 1, 'Semarak Perlombaan Olahraga \"Tandikek Cup\" : Ajang Prestasi dan Kebersamaan di Tandikek Barat', 0, NULL, NULL, NULL, NULL, '', 1, 'semarak-perlombaan-olahraga-tandikek-cup-ajang-prestasi-dan-kebersamaan-di-tandikek-barat', 3, NULL, 3),
(117, '1744858072_WhatsApp Image 2025-03-27 at 11.16.36.jpeg', '<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\">Dengan kegiatan Penyaluran bantuan langsung tunai dana desa ( BLT DD ) tahun 2025</p>\r\n<p style=\"text-align: justify;\">Bantuan Langsung Tunai Dana Desa adalah kegiatan pemberian bantuan langsung berupa dana tunai yang bersumber dari Dana Desa kepada Keluarga Penerima Manfaat (KPM) dan diputuskan melalui Musyawarah Desa sesuai dengan kriteria yang ditetapkan dalam peraturan perundang-undangan, Pemerintah Desa Dadapan melakukan kegiatan penyaluran Bantuan Langsung Tunai Dana Desa (BLT DD) Bulan Januari, februari dan Maret tahun 2025 sebanyak 33 KPM.</p>\r\n<p style=\"text-align: justify;\">Kegiatan ini dilaksakan di Aula MDA Lareh Nan Panjang Nagari Tandikek Barat yang dimulai pukul 10.00 WIB sampai Selesai. BLT DD bulan Januari-Maret Tahun 2025 telah disalurkan oleh Pemerintah Desa Dadapan kepada KPM (Keluarga Penerima Manfaat), setiap KPM menerima bantuan masing masing sebesar Rp 300.000,- setiap bulannya.</p>\r\n<p style=\"text-align: justify;\">Proses penyaluran BLT DD berlangsung dengan tertib dan kegiatan berjalan dengan lancar,</p>\r\n<p style=\"text-align: justify;\">Wali Nagari menegaskan diharapkan kepada Warga Masyarakat penerima manfaat agar memaksimalkan penggunaan bantuan tersebut untuk kebutuhan pokok seperti membeli bahan makanan sembako dan sebagainya sesuai kebutuhan di bulan Ramadhan ini, menjadi instrumen vital dalam pembangunan ekonomi lokal di berbagai pelosok desa.</p>\r\n<p style=\"text-align: justify;\">Melalui BLT-DD, pemerintah mengalokasikan dana untuk membantu warga desa dengan harapan dapat meningkatkan kesejahteraan mereka. Kegiatan penyaluran BLT-DD ini bertujuan untuk mendukung masyarakat kurang mampu secara finansial. Program ini telah menjadi salah satu langkah konkrit pemerintah dalam mengurangi dampak pandemi dan meningkatkan ketahanan pangan dan ekonomi masyarakat.</p>\r\n<p style=\"text-align: justify;\">&nbsp;Melalui kegiatan ini, diharapkan masyarakat Desa Dadapan akan merasakan manfaat langsung dari program ini, tambahnya</p>', 1, '2025-03-24 13:10:00', 1, 1, 'PENYALURAN DANA BANTUAN LANSUNG TUNAI TAHAP I (BLT-DD) TAHUN 2025', 0, '1744858072_WhatsApp Image 2025-03-27 at 11.16.43.jpeg', NULL, NULL, NULL, '', 1, 'penyaluran-dana-bantuan-lansung-tunai-blt-dd-tahun-2025', 3, NULL, 3),
(119, '1745372785_PENGUMUMAN.jpg', '<p><span data-huuid=\"5977784411285840572\">Penerimaan peserta didik baru (PPDB) TK biasanya dibuka di awal tahun ajaran baru, dan syarat utama adalah usia anak. </span><span data-huuid=\"5977784411285842595\">Untuk TK kelompok A (TK kecil), usia minimal 4 tahun pada tanggal 1 Juli tahun berjalan, sedangkan untuk TK kelompok B (TK besar), usia minimal 5 tahun. </span><span data-huuid=\"5977784411285840522\">Selain usia, persyaratan lain mungkin termasuk dokumen seperti akta kelahiran, Kartu Keluarga, dan foto.&nbsp;</span></p>\r\n<div class=\"NPrrbc\" data-cid=\"b2cb99c3-5694-455c-964c-48b419f50212\" data-uuids=\"5977784411285840572,5977784411285842595,5977784411285840522,5977784411285842545\">\r\n<div class=\"BMebGe btku5b fCrZyc LwdV0e FR7ZSc OJeuxf\" tabindex=\"0\" role=\"button\" aria-label=\"Lihat link terkait\" data-hveid=\"CC4QAQ\" data-ved=\"2ahUKEwi4-PGIgu2MAxUtyDgGHTpJAPkQ3fYKegQILhAB\">\r\n<div class=\"niO4u\">\r\n<div class=\"kHtcsd\"><img src=\"http://tandikek-barat.padangpariamankab.go.id/assets/../desa/upload/media/PENGUMUMAN.jpg\" alt=\"PENGUMUMAN\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"WaaZC\">\r\n<div class=\"RJPOee EIJn2\" style=\"animation: none !important;\">\r\n<div class=\"rPeykc pyPiTc\" data-hveid=\"CGIQAQ\" data-ved=\"2ahUKEwi4-PGIgu2MAxUtyDgGHTpJAPkQo_EKegQIYhAB\"><span data-huuid=\"5977784411285842495\">Syarat Usia: </span></div>\r\n</div>\r\n</div>\r\n<div class=\"WaaZC\">\r\n<div class=\"RJPOee EIJn2\" style=\"animation: none !important;\">\r\n<ul data-hveid=\"CC8QAQ\" data-ved=\"2ahUKEwi4-PGIgu2MAxUtyDgGHTpJAPkQm_YKegQILxAB\">\r\n<li><span data-huuid=\"5977784411285840372\"><strong>TK Kelompok A (TK Kecil):</strong> </span><span data-huuid=\"5977784411285842395\">Usia minimal 4 tahun pada tanggal 1 Juli tahun berjalan. </span></li>\r\n<li><span data-huuid=\"5977784411285842345\"><strong>TK Kelompok B (TK Besar):</strong> </span><span data-huuid=\"5977784411285840272\">Usia minimal 5 tahun pada tanggal 1 Juli tahun berjalan.<span class=\"pjBG2e\" data-cid=\"c1989233-e79a-46e0-8413-e009158e1a23\"><span class=\"UV3uM\">&nbsp;</span></span></span>\r\n<div class=\"NPrrbc\" data-cid=\"c1989233-e79a-46e0-8413-e009158e1a23\" data-uuids=\"5977784411285840372,5977784411285842395,5977784411285842345,5977784411285840272\">\r\n<div class=\"BMebGe btku5b fCrZyc LwdV0e FR7ZSc OJeuxf\" tabindex=\"0\" role=\"button\" aria-label=\"Lihat link terkait\" data-hveid=\"CCYQAQ\" data-ved=\"2ahUKEwi4-PGIgu2MAxUtyDgGHTpJAPkQ3fYKegQIJhAB\">\r\n<div class=\"niO4u\">\r\n<div class=\"kHtcsd\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"WaaZC\">&nbsp;</div>\r\n<div class=\"WaaZC\">\r\n<div class=\"RJPOee EIJn2\" style=\"animation: none !important;\">\r\n<div class=\"rPeykc pyPiTc\" data-hveid=\"CFsQAQ\" data-ved=\"2ahUKEwi4-PGIgu2MAxUtyDgGHTpJAPkQo_EKegQIWxAB\"><span data-huuid=\"5977784411285840222\">Dokumen yang Diperlukan: </span></div>\r\n</div>\r\n</div>\r\n<div class=\"WaaZC\">\r\n<div class=\"RJPOee EIJn2\" style=\"animation: none !important;\">\r\n<ul data-hveid=\"CE8QAQ\" data-ved=\"2ahUKEwi4-PGIgu2MAxUtyDgGHTpJAPkQm_YKegQITxAB\">\r\n<li><span data-huuid=\"5977784411285842195\"><strong>Akte Kelahiran:</strong> </span><span data-huuid=\"5977784411285840122\">Dokumen ini diperlukan sebagai bukti usia anak. </span></li>\r\n<li><span data-huuid=\"5977784411285840072\"><strong>Kartu Keluarga (KK):</strong> </span><span data-huuid=\"5977784411285842095\">Dokumen ini diperlukan sebagai bukti alamat dan status keluarga. </span></li>\r\n<li><span data-huuid=\"5977784411285842045\"><strong>Pas Foto:</strong> </span><span data-huuid=\"5977784411285839972\">Biasanya dibutuhkan beberapa lembar pas foto anak untuk keperluan pendaftaran. </span></li>\r\n<li><span data-huuid=\"5977784411285839922\"><strong>Formulir Pendaftaran:</strong> </span><span data-huuid=\"5977784411285841945\">Formulir ini harus diisi dengan lengkap dan benar.<span class=\"pjBG2e\" data-cid=\"28394eda-6470-4ec9-98eb-f7c07c52cb86\"><span class=\"UV3uM\">&nbsp;</span></span></span>\r\n<div class=\"NPrrbc\" data-cid=\"28394eda-6470-4ec9-98eb-f7c07c52cb86\" data-uuids=\"5977784411285842195,5977784411285840122,5977784411285840072,5977784411285842095,5977784411285842045,5977784411285839972,5977784411285839922,5977784411285841945\">\r\n<div class=\"BMebGe btku5b fCrZyc LwdV0e FR7ZSc OJeuxf\" tabindex=\"0\" role=\"button\" aria-label=\"Lihat link terkait\" data-hveid=\"CDoQAQ\" data-ved=\"2ahUKEwi4-PGIgu2MAxUtyDgGHTpJAPkQ3fYKegQIOhAB\">\r\n<div class=\"niO4u\">\r\n<div class=\"kHtcsd\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"WaaZC\">\r\n<div class=\"RJPOee EIJn2\" style=\"animation: none !important;\">&nbsp;</div>\r\n</div>', 1, '2025-04-23 12:41:06', 1, 1, 'PENERIMAAN DIDIK BARU TK PELANGI NAGARI TANDIKEK BARAT', 0, NULL, NULL, NULL, NULL, '', 1, 'penerimaan-didik-baru-tk-pelangi-nagari-tandikek-barat', 1, NULL, 3);
